(4, 214, 'Yohaig Nigerian News', 'candelariamcfadden@gmail.com', '', '108.162.238.53', '2017-06-29 10:53:07', '2017-06-29 10:53:07', 'Lokoja — The Nigerian Bar Affiliation (NBA) yesterday criticised the Federal Authorities on its current choice to construct new refineries with out open aggressive bidding \r\nopposite to the general public procurement act.\r\n\r\n\r\nThe Nationwide President of the NBA, Malam Abubakar Mahmoud,\r\nwho spoke on the Nationwide Govt Council (NEC) assembly of the affiliation in Lokoja, Kogi State, mentioned many Nigerians have \r\nbeen shocked at the choice.\r\n\r\n\r\nIn accordance with him: \\"It can ship mistaken indicators to companies and certainly buyers.\\"He, subsequently, requested the Federal Authorities to revamp most of \r\nthe legislations on businesses that play key function within the administration of the \r\nnation\\\'s economic system.\r\n\r\n\r\nHe listed the legislations that require evaluate to incorporate the general public procurement act, the privatisation act, the \r\ninfrastructure concession act and the regulatory fee act.\r\n\r\n\r\nBased on him: \\"There\\\'s a notion that these legislations establishing the businesses are now not efficient and have turn into a shadow of their previous. \\"We \r\nurge the federal government to take a tough have a look at these \r\nlegal guidelines and businesses which have direct bearing on financial administration and enhancing \r\ntransparency.\\"\r\n\r\n\r\nThe NBA president additionally commended Performing President Yemi Osinbajo for the three government orders not too long ago signed into legal guidelines aimed toward eradicating obstacles to non-public companies, authorities budgeting and motion of individuals and items between Nigeria and different international locations.\r\n\r\n\r\n\\"The orders are aimed to advertise transparency and effectivity in Nigeria\\\'s enterprise setting and \r\nhelp native content material in public procurement, amongst others,\\" he stated.He, subsequently, known as on the federal government for a diligent and efficient implementation of the insurance policies and the government orders.\r\n\r\n\r\nParticularly close to well timed submission of yearly budgetary estimates of the federal companies.Apart from, Mahmoud has additionally challenged the Federal Authorities on the dismal state of the Lokoja/Abuja Expressway, which had been beneath building for greater than eleven years.\r\n\r\n\r\nHe stated: \\"The contract was awarded in 2006 at the price of N42 billion. It was revised in 2011 to \r\nthe price of N116 billion and this challenge has \r\nremained uncompleted.\\"I exploit this alternative to name on the federal authorities to make sure the speedy completion of this street.', 0, '0', '', '', 0, 0),
(5, 67, 'Clarinda', 'xxkuowgn3bz@yahoo.com', '', '172.68.10.196', '2017-03-09 15:08:54', '2017-03-09 15:08:54', 'scglgminaeareetim on August 30, 2012                                                                    Hi Shawn,Great vid as always! What you describe here sounds akin to what Dr. Bob Rotella talks about in &#8220;Golf is Not a Game of Perfect&#8221;  You train your swing on the range and TRUST it on the course.  The pre-shot routine is one of the least taught aspects of the golf swing IMHO.  Never have a mechanical thought while playing.  Always be tuned into what you are doing at the present moment.  Thanks for all the great vids Shawn.  You&#8217;ve helped meï»¿ tremendously try to understand and play this game.', 0, '0', '', '', 0, 0),
