(7, 73, 'Marlien', '3pqw9b5n@mail.com', '', '172.68.10.196', '2017-03-09 15:27:18', '2017-03-09 15:27:18', 'in this post that they can now be posted \\"just about anywhere,\\" with the new crsmo-oubsissisn system.  Does this mean that sitemaps no longer need to be at the top of the hierarchy?  We\\\'re having server trouble with posting ours, and can only currently put them at the bottom of the hierarchy, and if we could just put it there it would potentially save us weeks of headache.  Thanks!', 0, '0', '', '', 0, 0),
