(9, 79, 'Mattie', '3u9kxpyhr@hotmail.com', '', '172.68.10.196', '2017-03-09 15:42:07', '2017-03-09 15:42:07', 'Last week I coeetnmmd on another blog that one of the best perks with the whole blogging thing is that readers get to see places they may never get to visit in real life.  Your post today just proves that point.  I have visited your great state but never in the fall.  I can now see why so many people want to visit you at this time of the year.  Glorious scenery!', 0, '0', '', '', 0, 0),
